import { Routes } from '@angular/router';

export const routes: Routes = [
    {
        path: '',
        loadChildren: () => import('./home-page/home-page.component').then(c => c.HomePageComponent)
    },
    {
        path: 'home-page',
        loadChildren: () => import('./home-page/home-page.component').then(c => c.HomePageComponent)
    },

];
